var new_items = [];

for(var i = static_data.Items.length; i--;){
	new_items.push({
		X: static_data.Items[i].firstAuthorPaperCount,
		Y: static_data.Items[i].firstAuthorCitationCount,
		X_real: static_data.Items[i].paperNumber,
		Y_real: static_data.Items[i].citationNumber,
		NormX: static_data.Items[i].firstAuthorPaperCount/ static_data.AvgX,
		NormY: static_data.Items[i].firstAuthorCitationCount / static_data.AvgY,
		firstAuthorName: static_data.Items[i].firstAuthorName,
		Notes: ''
	});
}

function stddev(data, mean){
	var variance = {
		x: 0, y: 0
	};

	for(var i = data.length; i--;){
		var dx = data[i].X - mean.x;
		var dy = data[i].Y - mean.y;
		variance.x += dx * dx;
		variance.y += dy * dy;
	}

	variance.x /= data.length;
	variance.y /= data.length;

	return {
		x: Math.sqrt(variance.x),
		y: Math.sqrt(variance.y)
	};
}

function mean(data){
	var avg = {x: 0, y: 0};
	for(var i = data.length; i--;){
		avg.x += data[i].X;
		avg.y += data[i].Y;
	}

	return {x: avg.x / data.length, y: avg.y / data.length};
}

var median = null, mean = null, std = null;
var Zoom = 0;
function __view(){
	var sorted = new_items.sort(function(a, b){ return a.X - b.X; });	
	chart.data.add(sorted);mean = chart.data.mean();
	median = sorted[sorted.length >> 1];
	std = chart.data.standardDeviation();

	var qw = chart.view.paper.width >> 2;
	var qh = chart.view.paper.height >> 2;

	var calculateZoom = function(){
		var a = Math.abs, dMax, dMin, tall = false;

		if(std.x > std.y){
			dMax = a(median.X - chart.data.x.max());
			dMin = a(median.X - chart.data.x.min());
		}
		else{
			tall = true;
			dMax = a(median.Y - chart.data.y.max());
			dMin = a(median.Y - chart.data.y.min());			
		}

		return { isTall: tall, value: dMin < dMax ? dMin : dMax }; 
	};

	Zoom = calculateZoom();

	chart.camera.jump(median.X, median.Y, Zoom.isTall ? qh / Zoom.value : qw / Zoom.value);
	chart.view.setOrigin([median.X, median.Y]);
}